// DEPENDENCIES
////////////////
// packages
import React, { Component } from 'react';
// data
import fortunes from './data.js'
import nightFortunes from './data2.js'
console.log(fortunes);
console.log(nightFortunes);

////////////////
// METHODS
////////////////

// run one time only lifecycle method...
