////////////////
// COMPONENT
////////////////
class App extends Component {
  constructor() {
    super()
    this.state = {
      fortunes: fortunes,
      nightFortunes: ''
    }
  }
  render() {
    return (
      <div className="fortune-container">
        <header>
          <h1>Good Fortune to You, Stranger...</h1>
          <h3>May the future smile upon you.</h3>
        </header>
      </div>
    )
  }
}

// <h4>{ fortunes.sample }</h4> // <-- This did not work. Tried putting it in the render.

////////////////
// EXPORT
////////////////
export default App;
